import React from "react";

const Benefits = () => {
  return (
    <>
      <h1>BENEFITS OF ELECTRIC VEHICLES</h1>
      <p>
        Transport is a fundamental requirement of modern life, but the
        traditional combustion engine is quickly becoming outdated. Petrol or
        diesel vehicles are highly polluting and are being quickly replaced by
        fully electric vehicles. Fully electric vehicles (EV) have zero tailpipe
        emissions and are much better for the environment. The electric vehicle
        revolution is here, and you can be part of it. Will your next vehicle be
        an electric one?
      </p>
      <h2>Lower running costs</h2>
      <h2>Low maintenance cost</h2>
      <h2>Zero Tailpipe Emissions</h2>
      <h2>Tax and financial benefits</h2>
    </>
  );
};
export default Benefits;
